const Diaryitem = ({ author, content, created_date, emotion, id }) => {
  return (
    <div className="Diaryitem">
      <div className="info">
        <span>작성자 : {author}</span>
      </div>
      <div key={it.id}>
        <div>작성자 : {author}</div>
        <div>일기 : {content}</div>
        <div>감정 : {imotion}</div>
        <div>작성 시간 : {created_date}</div>
      </div>
    </div>
  );
};
export default Diaryitem;
